    /* nubes  -- */
                .cloud {
                    width: 350px; height: 120px;

                    background: #FFF;
                    background: linear-gradient(top, #FFF 100%);
                    background: -webkit-linear-gradient(top, #FFF 100%);
                    background: -moz-linear-gradient(top, #FFF 100%);
                    background: -ms-linear-gradient(top, #FFF 100%);
                    background: -o-linear-gradient(top, #FFF 100%);
                    border-radius: 100px;
                    -webkit-border-radius: 100px;
                    -moz-border-radius: 100px;
                    position: absolute;
                    margin: 120px auto 20px;
                    z-index:-1;
                    transition: ease 1s;
                }

                .cloud:after, .cloud:before {
                    content: '';
                    position: absolute;
                    background: #FFF;
                    z-index: -1
                }

                .cloud:after {
                    width: 100px; height: 100px;
                    top: -50px; left: 50px;

                    border-radius: 100px;
                    -webkit-border-radius: 100px;
                    -moz-border-radius: 100px;
                }

                .cloud:before {
                    width: 180px; height: 180px;
                    top: -90px; right: 50px;

                    border-radius: 200px;
                    -webkit-border-radius: 200px;
                    -moz-border-radius: 200px;
                }
                
                .x1 {
                    top:-50px;
                    left:100px;
                    -webkit-transform: scale(0.3);
                    -moz-transform: scale(0.3);
                    transform: scale(0.3);
                    opacity: 0.9;
                    -webkit-animation: moveclouds 25s linear infinite;
                    -moz-animation: moveclouds 25s linear infinite;
                    -o-animation: moveclouds 25s linear infinite;
                  
                }
                
                .x1_5{
                    top:-80px;
                    left:250px;
                    -webkit-transform: scale(0.3);
                    -moz-transform: scale(0.3);
                    transform: scale(0.3);
                    -webkit-animation: moveclouds 17s linear infinite;
                    -moz-animation: moveclouds 17s linear infinite;
                    -o-animation: moveclouds 17s linear infinite; 
                }

                .x2 {
                    left: 250px;
                    top:30px;
                    -webkit-transform: scale(0.6);
                    -moz-transform: scale(0.6);
                    transform: scale(0.6);
                    opacity: 0.6; 
                    -webkit-animation: moveclouds 15s linear infinite;
                    -moz-animation: moveclouds 15s linear infinite;
                    -o-animation: moveclouds 15s linear infinite;
                }

                .x3 {
                    left: 250px; bottom: 70px;

                    -webkit-transform: scale(0.6);
                    -moz-transform: scale(0.6);
                    transform: scale(0.6);
                    opacity: 0.8; 

                    -webkit-animation: moveclouds 25s linear infinite;
                    -moz-animation: moveclouds 25s linear infinite;
                    -o-animation: moveclouds 25s linear infinite;
                }

                .x4 {
                    left: 470px; botttom: 20px;

                    -webkit-transform: scale(0.75);
                    -moz-transform: scale(0.75);
                    transform: scale(0.75);
                    opacity: 0.75;

                    -webkit-animation: moveclouds 80s linear infinite;
                    -moz-animation: moveclouds 80s linear infinite;
                    -o-animation: moveclouds 80s linear infinite;
                }

                .x5 {
                    left: 200px; top: 250px;

                    -webkit-transform: scale(0.5);
                    -moz-transform: scale(0.5);
                    transform: scale(0.5);
                    opacity: 0.8; 

                    -webkit-animation: moveclouds 120s linear infinite;
                    -moz-animation: moveclouds 120s linear infinite;
                    -o-animation: moveclouds 120s linear infinite;
                }

                @-webkit-keyframes moveclouds {
                    0% {margin-left: 2000px;}
                    100% {margin-left: -1000px;}
                }
                @-moz-keyframes moveclouds {
                    0% {margin-left: 1000px;}
                    100% {margin-left: -1000px;}
                }
                @-o-keyframes moveclouds {
                    0% {margin-left: 1000px;}
                    100% {margin-left: -1000px;}
                }

    #islote { 

      position:absolute;
      bottom:0;
      left:45%;


    }

    #mar {
      z-index:-1;
      position:absolute;
      bottom:-40px; 
      opacity:1;
      width:100%;
      fill: #80CCF8;
    }

    .message-box {
      height: 100%;
      width: 100%;
      text-align: center;
      font-size: 16px;
      font-family: 'Josefin Sans', sans-serif;
      padding: 240px 0 0 0px;
      -webkit-animation: moveclouds 20s linear infinite;
      -moz-animation: moveclouds 20s linear infinite;
      -o-animation: moveclouds 20s linear infinite;
    }
